import React from 'react';
import { View, StyleSheet, TouchableOpacity } from 'react-native';
import { FontAwesome5 } from '@expo/vector-icons'; // Import icons from FontAwesome5

const Footer = () => {
  return (
    <View style={styles.footer}>
      <TouchableOpacity style={styles.footerItem}>
        <FontAwesome5 name="home" size={28} color="darkblue" />
      </TouchableOpacity>
      <TouchableOpacity style={styles.footerItem}>
        <FontAwesome5 name="compass" size={28} color="darkblue" />
      </TouchableOpacity>
      <TouchableOpacity style={styles.footerItem}>
        <FontAwesome5 name="user" size={28} color="darkblue" />
      </TouchableOpacity>
      <TouchableOpacity style={styles.footerItem}>
        <FontAwesome5 name="dolly" size={28} color="darkblue" />
      </TouchableOpacity>
      <TouchableOpacity style={styles.footerItem}>
        <FontAwesome5 name="bars" size={28} color="darkblue" />
      </TouchableOpacity>
      
    </View>
  );
};

const styles = StyleSheet.create({
  footer: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    backgroundColor: '#fff',
    borderTopWidth: 1,
    borderTopColor: '#ccc',
    paddingHorizontal: 5,
    paddingVertical: 10,
  },
  footerItem: {
    flex: 1,
    alignItems: 'center',
  },
});

export default Footer;
